import Button from '../Button/button'
import Logo from '../logo/logo'
import Usermenu from '../usermenu/usermenu'
import './navbar.css'

const NavBar = () => {
    return(
        <div >
            <div className="navbar">
                <Logo/>
                <div className = "button_Home">
                <Button  text="Home"/>
                </div>

                <Usermenu/>
            </div>

        </div>
    );
};

export default NavBar;
